import React from 'react';
import './CaseStudySolution.css';

function CaseStudySolution({ title, description, image }) {
  return (
    <div className="case-study-solution">
      <h2 className="solution-label">SOLUTION</h2>
      <div className="solution-content">
        <div className="solution-text">
          <h3>{title}</h3>
          <p>{description}</p>
        </div>
        <div className="solution-image">
          <img src={image} alt="Solution illustration" />
        </div>
      </div>
    </div>
  );
}
